import "./service_style.css"
import Hero from '../components/Hero';
import NavBar from '../components/NavBar';
import ImageSrc from "../asserts/Service.jpg"
import Footer from '../components/Footer';
import Trip from '../components/Trip';

import src1 from "../asserts/service1.png"
import src2 from "./asser"
export default function Service(){
    const dataList=[
        {src:src1,
        title: "Luxury Plan \t 2000$ per year",
        text: <><ul><li>- 20000$ per year</li><li>- Two romantic trips per year</li> <li>- Photograpers and Videomakers follows you during your adventure</li><li>-Two Luxury dinners in the best restaurant on each Trip</li></ul><br></br><h4>Description:</h4><p>Experience opulent accommodations, curated experiences, and exquisite destinations, creating unforgettable moments tailored to elevate your journey together. Explore the epitome of romance with our meticulously crafted plan designed for the discerning couple seeking lavish escapes.</p> </>
    },
    {src: src2, }
    ];

    return(
        <div className='Service'>
            <NavBar/>
            {/* <h1>This is Service</h1> */}
            <Hero
                cName="hero-mid"
                src= {ImageSrc}
                title="Service"
                btnClass="hide"

            />
                <Trip title="Choose Your Plan"
                    dataList={dataList}
                />
            <Footer/>
        </div>
    );
}
